import React from "react";
import { useState } from "react";
import MobileViewInfo from "common/components/MobileViewInfo";
import { BrowserView, MobileOnlyView } from "react-device-detect";
import Launch_Mobile from "modules/photoBooth/components/pbMobile";
import Launch_Desktop from "modules/photoBooth/components/pbDesktop";

const PhotoBooth = () => {
  const [page, setPage] = useState(<Launch_Desktop />);
  return (
    <>
      <BrowserView>page</BrowserView>
      <MobileOnlyView>
        <Launch_Mobile />
      </MobileOnlyView>
    </>
  );
};

export default PhotoBooth;
